import React from 'react';

class SignIn extends React.Component{
    constructor(){
        super();
        this.state={
            email:'',
            password:''
        }
    }
    change=(e)=>{
        alert('hello')
    }

    render(){
        const {email,password}=this.state;
        return(
            <div className="sign-in">
                <h2>I already have a</h2>
            <form>
                <input type="email" value={email} required handlechange={this.change} name="email"/>
                <input type="password" value={password} required/>
                <input type="submit"/>
            </form>
            </div>
        )
    }
}

export default SignIn;
